g.inkscape:label:
{"attr":"script","list":[{"evt":"mouseup","param":"if (getTag('device_%PLC_status_connected')) {
	if (getTag('JF_%BORE_%NO_Forward')||getTag('JF_%BORE_%NO_Reverse')) {
		if (getTag('Emergency_Mode')) {
			alert('Cannot command JF-%BORE-%NO due to system Emergency Operation Mode. For Manual command please proceed using Ventilation Fallback Panel or Local Panel.');
		} else if (getTag('Maintenance_Mode')) {
			alert('Cannot command JF-%BORE-%NO due to system Maintenance Operation Mode. For Manual command please proceed using Ventilation Fallback Panel or Local Panel.');
		} else if (!getTag('JF_%BORE_FP_Auto')) {
			alert('Cannot command JF-%BORE-%NO due to Downline Ventilation Fallback Panel is not in Auto mode');
		} else if (!getTag('JF_%BORE_%NO_Auto')) {
			alert('Cannot command the JF-%BORE-%NO due to JF-%BORE-%NO local panel is not in Auto mode');
		} else {
			var answer = confirm('Command stop JF-%BORE-%NO?');
			if (answer) {
				if (!getTag('JF_%BORE_%NO_Off_Cmd')) { setTag('JF_%BORE_%NO_Off_Cmd', 1);}
				if (getTag('JF_%BORE_%NO_On_Cmd')) { setTag('JF_%BORE_%NO_On_Cmd', 0);}
			}
		}
	}
} else {
		alert('Cannot command JF-%BORE-%NO due to %PLC PLC not responding.');
}"}]}

{"attr":"script","list":[{"evt":"mouseup","param":"if (getTag('device_%PLC_status_connected')) {
	if (!(getTag('JF_%BORE_%NO_Forward')||getTag('JF_%BORE_%NO_Reverse'))) {
		if (getTag('Emergency_Mode')) {
			alert('Cannot command JF-%BORE-%NO due to system Emergency Operation Mode. For Manual command please proceed using Ventilation Fallback Panel or Local Panel.');
		} else if (getTag('Maintenance_Mode')) {
			alert('Cannot command JF-%BORE-%NO due to system Maintenance Operation Mode. For Manual command please proceed using Ventilation Fallback Panel or Local Panel.');
		} else if (!getTag('JF_%BORE_FP_Auto')) {
			alert('Cannot command JF-%BORE-%NO due to Ventilation Fallback Panel is not in Auto mode');
		} else if (!getTag('JF_%BORE_FP_EStop')) {
			alert('Cannot command JF-%BORE-%NO due to Ventilation Fallback Panel emergency stop signal is activated');
		} else if (!getTag('JF_%BORE_%NO_Auto')) {
			alert('Cannot command the JF-%BORE-%NO due to JF-%BORE-%NO local panel is not in Auto mode');
		} else if (getTag('JF_%BORE_%NO_EStop')) {
			alert('Cannot command JF-%BORE-%NO due to JF-%BORE-%NO local panel emergency stop signal is activated');
		} else {
			var direction = getTag('JF_%BORE_%NO_Direction_Cmd')? 'REVERSE':'FORWARD';
			var answer = confirm('Command run JF-%BORE-%NO in '+direction+' direction?');
			if (answer) {
				if (getTag('JF_%BORE_%NO_Off_Cmd')) { setTag('JF_%BORE_%NO_Off_Cmd', 0);}
