			}
		}
	}
} else {
	alert('Cannot command JF-%BORE-%NO due to %PLC PLC not responding.');
}"}]}

circle.inkscape:label:
{"attr":"opac","max":1,"min":0,"tag":"JF_%BORE_FP_Auto"},{"attr":"tooltips","param":["Click to change Jet Fan direction"],"size":12,"style":""},{"attr":"script","list":[{"evt":"mouseup","param":"if (getTag('Emergency_Mode')) {
	alert('Cannot change Jet Fan direction while in Emergency Operation Mode.');
